import {Container, Row, Col, Navbar, Nav} from 'react-bootstrap';
import logo from '../../assets/kido-logo.jpg'
import { FaPhoneAlt } from 'react-icons/fa';



function Main(props) {


    return(
        <>
            <section className="banner py-5">
                <Container >
                    <Row className="justify-content-md-center" className="bg-border-btm bg-border-top">
                        <Col className="text-center" xs lg="10" md={10}>
                            <img src={logo} width="500" className="img-fluid"/>
                        </Col>
                    </Row>
                </Container>
            </section>

            <section>

            </section>

        </>
    )
}


export default Main;
